import Navigation from '../../Containers/Navigation/Navigation'

class About extends Component {
    render() {
        return(
            <div>
                <Navigation />
                <div className="about">
                    <figure className="portrait"></figure>
                    <aside></aside>
                </div>
            </div>
        )
    }
}

export default About
